export const notesAndTodos = {
    state: () => ({
       notes: [
           {id: 1, title: 'Products Categories'},
           {id: 2, title: 'Burger Menu'}
       ],
        todos: [
            {id: 1, todo: 'Make adaptive design', completed: false}
        ]
    }),
    mutations: {
        setNotes(state, notes){
            state.notes = notes
        },
    },
    actions: {
        createNote({commit}, note){
            commit('setNotes', note)
        }
    },
    namespaced: true
}
